from torchvision.models import resnet
net = resnet.ResNet(resnet.Bottleneck, [2,2,2,2])

def split_image_into_grid(original_image, rows, cols):
    width, height = original_image.size
    cell_width = width // cols
    cell_height = height // rows

    to_return = []
    for row in range(rows):
        for col in range(cols):
            left = col * cell_width
            top = row * cell_height
            right = left + cell_width
            bottom = top + cell_height
            cell_image = original_image.crop((left, top, right, bottom))
            to_return.append(cell_image)
    return to_return

def call_model(net, transform, what_image):
    with torch.no_grad():
        transformed = transform(what_image).unsqueeze(0)
        outputs = net(transformed)
        _, predictions = torch.max(outputs, 1)
        # collect the correct predictions for each class
        if(predictions[0] == 1):
            return True
        else:
            return False
if __name__=="__main__":
    #Load model
    PATH = 'good_model_resnet.pth'
    net.load_state_dict(torch.load(PATH, map_location='cpu'))
    transform = transforms.Compose(
        [transforms.ToTensor(),
         transforms.Normalize((0.5, 0.5, 0.5), (0.5, 0.5, 0.5))])


    app = Flask("CaptchaAPI")

    @app.route("/status")
    def status():
        print("status")
        return "Success", 200

    @app.route("/captcha", methods=['POST'])
    def captcha():
        print("image request")
        image = str(request.data)
        ans = "ABCDEF"
        for (numba, pil_img) in enumerate(split_image_into_grid(PIL.Image.open(io.BytesIO(base64.b64decode(image.split(",")[1]))).convert("RGB"), 2, 3)):
            resized = pil_img.resize((100, 100))
            if(call_model(net, transform, resized)):
                print(ans[numba])
        return "Success", 200
